import Layout from '../../components/Layout';
import Private from '../../components/auth/Private';
import Link from 'next/link';
import {FC} from 'react';

const UserIndex:FC = () => {
    return (
        <Layout>
            <Private>
                <h2>User Dashboard</h2>
            </Private>
        </Layout>
    );
};

export default UserIndex;
